import styled from 'styled-components';

export const NavMenu = styled.nav`
    display: flex;
    justify-content: space-between;
    padding: 0.5rem;
    align-items: center;
    margin-left: 1rem;
    margin-right: 1rem;

    ul {
        transform: translateX(30rem);



    }
`

export const Logo = styled.div`
    font-size: 1.5rem;

`
